        if (conf_ctx == NULL)
            return AXIS2_FAILURE;
    
        conf = axis2_conf_ctx_get_conf(conf_ctx, env);
        if (conf == NULL)
            return AXIS2_FAILURE;

        module_qname = axutil_qname_create(env, module_name, NULL, NULL);
